const styles = {
  imgStyle: {
    hight: 'auto',
    width: '80%',
    border: '4px solid RebeccaPurple ',
    borderRadius: '5%',
  },
  articleStyle: {
    width: '50%',
    margin: '0 auto',
    color: 'olive',
  },
  tableStyle: {
    //border: '1px solid black',
    margin: '30px',
    tableLayout: 'fixed',
    display: 'inline-block',
    //minWidth: '400px',
    minHeight: '60px',
    textAlign: 'center',
  },
  tdHeaderStyle: {
    border: '1px solid black',
    padding: '5px',
    width: '25%',
  },
  tdBodyStyle: {
    border: '1px solid black',
    padding: '5px',
    fontSize: '14px',
    width: '25%',
  },
};

export default styles;
